<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Will You Be My Valentine? ðŸ’•</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Georgia', serif;
            background: linear-gradient(135deg, #ffeef8 0%, #ffe0f0 100%);
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            overflow-x: hidden;
            position: relative;
        }

        .container {
            text-align: center;
            padding: 20px;
            max-width: 800px;
            position: relative;
            z-index: 10;
        }

        .intro-message {
            font-size: 2.5em;
            color: #d63384;
            font-weight: bold;
            margin-bottom: 40px;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.1);
            font-style: italic;
        }

        .words-container {
            min-height: 150px;
            margin-bottom: 40px;
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            align-items: center;
            gap: 15px;
        }

        .line-break {
            width: 100%;
            height: 0;
        }

        .word {
            font-size: 3em;
            color: #d63384;
            font-weight: bold;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.1);
            opacity: 0;
            animation: gradientFadeIn 2s ease-out forwards;
        }

        @keyframes gradientFadeIn {
            0% {
                opacity: 0;
                background: linear-gradient(90deg, transparent 0%, transparent 100%);
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
                background-clip: text;
            }
            50% {
                background: linear-gradient(90deg, #d63384 0%, transparent 50%, transparent 100%);
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
                background-clip: text;
            }
            100% {
                opacity: 1;
                background: linear-gradient(90deg, #d63384 0%, #ff69b4 100%);
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
                background-clip: text;
            }
        }

        .photo-container {
            margin: 30px 0;
            position: relative;
            height: 350px;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .photo-container img {
            max-width: 300px;
            max-height: 300px;
            border-radius: 20px;
            box-shadow: 0 10px 30px rgba(214, 51, 132, 0.3);
            border: 5px solid white;
        }

        .photo-container.all-photos {
            height: auto;
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 15px;
            max-width: 600px;
            margin: 20px auto;
        }

        .photo-container.all-photos img {
            max-width: 100%;
            max-height: 150px;
            width: 100%;
            object-fit: contain;
            border-radius: 15px;
            box-shadow: 0 5px 15px rgba(214, 51, 132, 0.3);
            border: 3px solid white;
        }

        .photo-container.all-photos img:nth-child(4) {
            grid-column: 1 / 2;
            grid-row: 2;
        }

        .photo-container.all-photos img:nth-child(5) {
            grid-column: 3 / 4;
            grid-row: 2;
        }

        button {
            background: linear-gradient(135deg, #ff6b9d 0%, #d63384 100%);
            color: white;
            border: none;
            padding: 20px 50px;
            font-size: 1.5em;
            border-radius: 50px;
            cursor: pointer;
            box-shadow: 0 8px 20px rgba(214, 51, 132, 0.4);
            transition: all 0.3s ease;
            font-weight: bold;
        }

        button:hover {
            transform: translateY(-3px);
            box-shadow: 0 12px 30px rgba(214, 51, 132, 0.5);
        }

        button:active {
            transform: translateY(-1px);
        }

        .heart {
            position: fixed;
            font-size: 30px;
            animation: fall linear forwards;
            z-index: 1;
            pointer-events: none;
        }

        @keyframes fall {
            to {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }

        .message {
            margin-top: 30px;
            font-size: 1.3em;
            color: #d63384;
            opacity: 0;
            animation: fadeIn 1s ease-out forwards;
        }

        @keyframes fadeIn {
            to {
                opacity: 1;
            }
        }

        .popup-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.7);
            display: none;
            justify-content: center;
            align-items: center;
            z-index: 10000;
        }

        .popup-overlay.show {
            display: flex;
        }

        .popup-content {
            background: linear-gradient(135deg, #fff 0%, #ffe0f0 100%);
            padding: 50px;
            border-radius: 30px;
            text-align: center;
            box-shadow: 0 20px 60px rgba(214, 51, 132, 0.5);
            max-width: 500px;
            border: 5px solid #ff69b4;
        }

        .popup-content h2 {
            font-size: 3em;
            color: #d63384;
            margin-bottom: 30px;
            text-shadow: 0 0 20px rgba(214, 51, 132, 0.5);
        }

        .popup-buttons {
            display: flex;
            gap: 20px;
            justify-content: center;
            margin-top: 30px;
        }

        .popup-button {
            padding: 20px 60px;
            font-size: 1.5em;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            font-weight: bold;
            transition: all 0.3s ease;
            box-shadow: 0 8px 20px rgba(0, 0, 0, 0.3);
        }

        .yes-button {
            background: linear-gradient(135deg, #00ff88 0%, #00cc66 100%);
            color: white;
        }

        .yes-button:hover {
            transform: scale(1.1);
            box-shadow: 0 12px 30px rgba(0, 255, 136, 0.5);
        }

        .no-button {
            background: linear-gradient(135deg, #ff6b6b 0%, #cc0000 100%);
            color: white;
        }

        .no-button:hover {
            transform: scale(1.1);
            box-shadow: 0 12px 30px rgba(255, 107, 107, 0.5);
        }
    </style>
</head>

        function handleClick() {
            if (currentIndex < words.length) {
                // Hide intro message on first click
                if (currentIndex === 0) {
                    document.getElementById('introMessage').style.display = 'none';
                }
                
                // Add word with gradient fade
                const wordElement = document.createElement('div');
                wordElement.className = 'word';
                wordElement.textContent = words[currentIndex];
                document.getElementById('wordsContainer').appendChild(wordElement);

                // Add line break after "Be"
                if (currentIndex === 2) {
                    const lineBreak = document.createElement('div');
                    lineBreak.className = 'line-break';
                    document.getElementById('wordsContainer').appendChild(lineBreak);
                }

                // Replace photo (show only one at a time)
                if (currentIndex < photos.length) {
                    const photoContainer = document.getElementById('photoContainer');
                    photoContainer.innerHTML = `<img src="${photos[currentIndex]}" alt="Memory ${currentIndex + 1}">`;
                }

                // If it's the last word (Valentine?), make hearts rain
                if (currentIndex === words.length - 1) {
                    document.getElementById('clickBtn').style.display = 'none';
                    startHeartRain();
                    
                    // Show popup after animation
                    setTimeout(() => {
                        document.getElementById('popupOverlay').classList.add('show');
                    }, 7000);
                }

                currentIndex++;
            }
        }

        function createHeart() {
            const heart = document.createElement('div');
            heart.className = 'heart';
            heart.innerHTML = ['â¤ï¸', 'ðŸ’•', 'ðŸ’–', 'ðŸ’—', 'ðŸ’'][Math.floor(Math.random() * 5)];
            heart.style.left = Math.random() * 100 + 'vw';
            heart.style.animationDuration = (Math.random() * 3 + 3) + 's';
            heart.style.opacity = Math.random() * 0.5 + 0.5;
            document.body.appendChild(heart);

            setTimeout(() => {
                heart.remove();
            }, 6000);
        }

        function startHeartRain() {
            // Create multiple hearts immediately
            for (let i = 0; i < 30; i++) {
                setTimeout(() => createHeart(), i * 100);
            }
            
            // Continue creating hearts
            const interval = setInterval(createHeart, 300);
            
            // Stop after 10 seconds
            setTimeout(() => clearInterval(interval), 10000);
        }

        function handleYes() {
            document.getElementById('popupOverlay').style.display = 'none';
            
            // Show all 5 photos in a grid
            const photoContainer = document.getElementById('photoContainer');
            photoContainer.className = 'photo-container all-photos';
            photoContainer.innerHTML = '';
            
            photos.forEach((photo, index) => {
                const img = document.createElement('img');
                img.src = photo;
                img.alt = `Memory ${index + 1}`;
                photoContainer.appendChild(img);
            });
            
            // Create celebration
            const message = document.createElement('div');
            message.className = 'message';
            message.innerHTML = 'ðŸŽ‰ YAY! You made me the happiest person ever! ðŸ’–âœ¨ðŸŽŠ';
            message.style.fontSize = '2em';
            document.getElementById('messageContainer').appendChild(message);
            
            // More hearts!
            for (let i = 0; i < 50; i++) {
                setTimeout(() => createHeart(), i * 50);
            }
        }

        function handleNo() {
            // Make the No button run away or just show a cute message
            alert("Come on... give me another chance! ðŸ¥ºðŸ’•");
        }
    </script>
